<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width,initial-scale=1" />
  <title>ArchiaAi | Admin</title>
  <meta name="description" content="Generate fully SEO-optimized blog posts for ArchiaStudio automatically.">
  <link rel="stylesheet" href="../../../warehouse/css/warehouse.css">
  <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/toastify-js/src/toastify.min.css">
  <link rel="icon" href="../../../warehouse/data/images/icon.png" sizes="32x32">

  <style>
body {
    font-family: Causten-ExtraBold, sans-serif;
    background: #000; /* fallback before script fade loads */
    color: #222;
    margin: 0;
    padding: 0;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    height: 100vh;
    overflow: hidden;
    transition: background 2s ease-in-out;
  }

      .fullscreen-video-container {
  position: fixed;
  height: 100vh; 
  width: 100vw;
  overflow: hidden;
}

.fullscreen-video-container video {
  position: absolute;
  width: auto;
  height: auto;
  min-width: 100%;
  min-height: 100%;
}

  .hidden {
    display: none !important;
  }

  /* üåà Main Panels (centered glass boxes) */
  #password-screen,
  #main-screen {
    width: 100%;
    max-width: 800px;
    text-align: center;
    background: rgba(255, 255, 255, 0.15);
    backdrop-filter: blur(20px);
    -webkit-backdrop-filter: blur(20px);
    border-radius: 20px;
    border: 1px solid rgba(255, 255, 255, 0.3);
    box-shadow:
      0 8px 32px rgba(0, 0, 0, 0.1),
      inset 0 1px 0 rgba(255, 255, 255, 0.5),
      inset 0 -1px 0 rgba(255, 255, 255, 0.1),
      inset 0 0 20px 10px rgba(255, 255, 255, 1);
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    overflow: hidden;
    background: linear-gradient(
      180deg,
      rgba(255, 255, 255, 0.8),
      transparent,
      rgba(255, 255, 255, 0.3)
    );
    padding: 40px;
    transition: opacity 0.8s ease-in-out, transform 0.8s ease-in-out;
  }

  #password-screen.hidden,
  #main-screen.hidden {
    opacity: 0;
    pointer-events: none;
  }

  #password-screen:not(.hidden),
  #main-screen:not(.hidden) {
    opacity: 1;
    transform: translate(-50%, -50%) scale(1);
  }

  /* üñã Inputs */
  input {
    width: 90%;
    padding: 12px 14px;
    margin: 10px 0;
    border-radius: 10px;
    border: 1px solid rgba(200, 200, 200, 0.6);
    font-size: 16px;
    outline: none;
    background: rgba(255, 255, 255, 0.8);
    transition: all 0.3s ease;
  }

  input:focus {
    border-color: #4caf50;
    box-shadow: 0 0 10px rgba(102, 190, 0, 0.3);
    background: rgba(255, 255, 255, 1);
  }

  /* üöÄ Buttons */
  button {
    background: #66be00;
    color: #fff;
    border: none;
    padding: 12px 20px;
    border-radius: 10px;
    cursor: pointer;
    margin: 5px;
    font-family: inherit;
    font-size: 16px;
    transition: all 0.3s ease-in-out;
  }

  

  button:hover {
    background: #2e9800;
    transform: translateY(-2px);
    box-shadow: 0 5px 15px rgba(46, 152, 0, 0.4);
  }

  /* üñº Image Preview */
  img#preview {
    height: 18rem;
    width: 80%;
    max-height: 18rem;
    max-width: 80%;
    margin-top: 15px;
    object-fit: cover;
    border-radius: 10px;
    transition: transform 0.3s ease, opacity 0.5s ease;
  }

  img#preview:hover {
    transform: scale(1.02);
  }

  /* ‚úÖ Status Text */
  #status {
    margin-top: 20px;
    font-weight: bold;
    color: green;
  }

  /* üì± Responsive */
  @media (max-width: 768px) {
    #password-screen,
    #main-screen {
      width: 90%;
      padding: 25px;
    }

    input,
    button {
      font-size: 14px;
    }
  }
  </style>
</head>
